import React from "react";
import FilterButtons  from "../Buttons/Buttons";
import {RangeButtons } from "../Buttons/Buttons";
import "./Filter.css";
import { useState } from "react";

const Filter: React.FC = () => {

  return (
    <>
    <div id="main-filter">
      <div id="filter-div">
        <FilterButtons name="All" />
        <FilterButtons name="New" />
        <FilterButtons name="Most Popular" />
        <FilterButtons name="Open Now" />
        <FilterButtons name="Map View" />
      </div>
      <div id="range-div">
        <RangeButtons name="Price Range" />
        <RangeButtons name="Distance" />
        <RangeButtons name="Rating" />
      </div>

    </div>
    </>
  );
};

export default Filter;
